const root = ReactDOM.createRoot(document.getElementById('root'));
const Routing = () => {
  return(
<BrowserRouter>
<Routes>
        <Route exact path="/" component={App} />
        <Route path="/about" component={About} />
        <Route path="/service" component={Service} />
    </Routes>
</BrowserRouter>
  )
}
root.render(
